import React from 'react'
import './Login.css'
function Login() {
    return (
        <div className="Login">
            <h1>Login</h1>
            <div className="LoginForm">
                <input
                    type="text"
                    placeholder="Username"
                    onChange={(event) => {
                        setUsername(event.target.value)

                    }}

                />
                <input
                    type="Password"
                    placeholder="Password"
                    onChange={(event) => {
                        setPassword(event.target.value)

                    }}

                />
                <button>

                    Login
                     </button>
            </div>
        </div>
    )
}

export default Login
